  return (
      <Router>
      <Routes>
        <Route path='/' element={<Main/>}/>
        <Route path='/reg' element={<Registration/>}/>
        <Route path='/auth' element={<Authorization/>}/>
      </Routes>
      </Router>
  );
}

export default App;
